عن عائشة رضي الله عنها قالت :

أن النبي ﷺ كان إذا أوى إلى فراشه كل ليلة، جمع كفيه ثم نفث فيهما، فقرأ فيهما : {قل هو الله أحد }
و{ قل أعوذ برب الفلق } 
و{ قل أعوذ برب الناس }
ثم يمسحُ بهما ما استطاع من جسده، يبدأُ بهما على رأسه ووجهه، وما أقبل من جسده، يفعل ذلك ثلاث مرات

البخاري
